const useStyles = makeStyles((theme) => ({
        root: {
          flexGrow: 1,
        },


      }));


export default function RecentItems(props){

        
        const classes = useStyles();
        return(
                
                <div>
                        {recentItemsList.map(item =>
                                              <tr>
                                              <td><Icon>{item.icon}</Icon></td>
                                              <td>{item.title}</td>
                                              <td>{item.subject}</td>
                                              <td>{item.lastOpened}</td>
                                            </tr>
                        )}
                </div>
        )

}
